  const Home = true;
  const P1 = false;
  const P2 = false;
  return (
    <React.Fragment>
      {Home && <HomePage></HomePage>}
      {P1 && <Project1></Project1>}
      {P2 && <Project2></Project2>}
    </React.Fragment>


  );
}

export default App;
